import axios from "axios";
import { useState, useEffect} from "react";
import infiniteScroll from 'infinite-scroll';

export default function App() {

  document.addEventListener("DOMContentLoaded", () => {
    let options = {
      root: null,
      rootMargins: "0px",
      threshold: 0.5
    }
    const oberver = new IntersectionObserver(handleIntesect, options)
    oberver.observe(document.querySelector("footer"))

    getData();
  });

  function handleIntersect(entries) {
    if (entries[0].isIntersecting) {
      console.warn('Something is bad')
      getData();
    }
  }

  function getData() {
    const [results, setResults] = useState([])

    useEffect(() => {
      axios
        .get('./Foodsource.json')
        .then(res => { 
          setResults(res.data)
        })
        .catch(e => { console.log(e)}) },[]);


    const displayData = results.map(
      (info)=> {
        return(
          <tr>
            <td>{info.resteraunt}</td>
            <td>{info.name}</td>
            <td>{info.people}</td>
            <td>{info.timetag}</td>
          </tr>
        )
      }
    )
  }




  return (
    <div className="App">
      <div>
      <table class="table table-striped">
        <thead>
          <tr align="left">
            <th>Resteraunts &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</th>
            <th>Food Item</th>
            <th>Number of times bought &nbsp;</th>
            <th>How recently bought</th>
          </tr>
        </thead>
        <tbody>
          {displayData}
        </tbody>
      </table>
    </div>
    </div>


  );
}
